(() => {
  "use strict";
  document.onreadystatechange = () => {
    if ("complete" === document.readyState) {
      setTimeout(processPrompts, 1200);
    }
  };
  let originalTitle = document.title;
  const observer = new MutationObserver((mutations) => {
    if (document.title !== originalTitle) {
      originalTitle = document.title;
      if ("/chat" === document.location.pathname) {
        setTimeout(processPrompts, 1200);
      }
    }
  });
  observer.observe(document, { subtree: true, childList: true });
  window.addEventListener("beforeunload", function (e) {
    observer.disconnect();
  });
  const processPrompts = async () => {
    var promptsContainer = document.createElement("div");
    promptsContainer.setAttribute(
      "class",
      "flex flex-1 flex-grow-0 ml-auto mr-auto flex-col  md:max-w-2xl lg:max-w-3xl"
    );
    const promptsHeader = document.createElement("h2");
    promptsHeader.setAttribute("class", "mb-3");
    promptsHeader.innerHTML = "Prompts";
    promptsContainer.appendChild(promptsHeader);

    const promptsList = document.createElement("ul");
    promptsList.setAttribute("class", "flex gap-3.5 overflow-y-auto");
    promptsList.setAttribute(
      "style",
      "flex-wrap: wrap;flex: 1 0 auto; height: 340px; align-items: flex-start;"
    );

    // Create the input element
    const searchInput = document.createElement("input");
    searchInput.setAttribute(
      "class",
      "mb-3 p-3 md:p-4 relative resize-none rounded-lg shadow-[0_0_10px_rgba(0,0,0,0.10)] w-full outline-none border border-black/10 bg-white shadow-xs dark:shadow-xs dark:bg-gray-700 dark:text-white "
    );
    searchInput.setAttribute("placeholder", "Search prompts..");
    searchInput.onkeyup = (e) => {
      const searchTerm = e.target.value.toLowerCase();
      Array.from(promptsList.children).forEach((child) => {
        const promptText = child.innerHTML.toLowerCase();
        child.style.display = promptText.includes(searchTerm) ? "" : "none";
      });
    };
    promptsContainer.appendChild(searchInput);
    try {
      const response = await fetch("https://prompts.creationnext.com/api.cfm");
      if (!response.ok) {
        throw new Error("Failed to fetch prompts");
      }
      const data = await response.json();
      const prompts = data.DATA;
      const textarea = document.querySelector('textarea[data-id="root"]');
      for (let i = 1; i < prompts.length; i++) {
        const prompt = prompts[i];
        const listItem = document.createElement("li");
        listItem.setAttribute(
          "class",
          "flex-1 bg-gray-50 dark:bg-white/5 p-3 rounded-md hover:bg-gray-200 dark:hover:bg-gray-900 flex items-center justify-center text-center cursor-pointer"
        );
        listItem.setAttribute("style", "min-width: 40%;");
        listItem.innerHTML = prompt[0];
        listItem.onclick = () => {
          textarea.value = prompt[1];
          textarea.dispatchEvent(new Event("input", { bubbles: true }));
        };
        promptsList.appendChild(listItem);
      }
      promptsContainer.appendChild(promptsList);
    } catch (error) {
      console.error(error);
    }

    // create logo section
    const logoSection = document.createElement("div");
    logoSection.setAttribute("class", "flex justify-center");
    logoSection.innerHTML =
      '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" width="130" height="130" viewBox="0 0 100 100"><image id="_200X200" data-name="200X200" width="100" height="100" xlink:href="data:image/png;base64,"/></svg>';

    // hide chatGPT and Butoon from ChatGTP main section
    const targetElements = document.querySelectorAll("h1");
    targetElements.forEach((targetElement) => {
      if (targetElement.textContent.includes("ChatGPT")) {
        var parentElement = targetElement.parentNode;
        parentElement.insertBefore(logoSection, targetElement);
        parentElement.insertBefore(promptsContainer, targetElement);
        // remove ChatGPT heading "H1"
        parentElement.removeChild(targetElement);
        // remove chatGPT buttons
        var previousSibling = parentElement.previousElementSibling;
        if (previousSibling) {
          previousSibling.remove();
        }
        // remove padding previous node
        if (parentElement.parentNode.classList.contains("pb-64")) {
          parentElement.parentNode.classList.remove("pb-64");
        }
      }
    });

    // remove ChatGPT prompt
    let resizeTimeout;
    function hideSpecificChildNode() {
      const formElements = document.querySelectorAll(".grow");
      formElements.forEach((divElement) => {
        if (
          divElement.classList.length === 1 &&
          divElement.classList.contains("grow")
        ) {
          const nodeToHide = divElement.children[0];
          if (nodeToHide) {
            nodeToHide.style.display =
              window.innerWidth <= 768 ? "none" : "none";
          }
        }
      });
    }
    function handleResize() {
      clearTimeout(resizeTimeout);
      resizeTimeout = setTimeout(hideSpecificChildNode, 0); // Adjust the debounce time as needed
    }
    // Call the function initially
    hideSpecificChildNode();
    // Listen for window resize events
    window.addEventListener("resize", handleResize);
  };
})();
